import Footer from "./Footer";
import HomeUpdates from "./HomeUpdates";
import Jumbotron from "./Jumbotron";
import NavigationBar from "./NavigationBar";

const Home = () => {
  return (
    <div className="home">
      <NavigationBar />
      <Jumbotron />
      <HomeUpdates className="home  main-container" />
      <Footer />
    </div>
  );
};
export default Home;
